sys_variable_value.value:
(function execute(inputs, outputs) {  
  var message = JSON.parse(inputs.responseBody);
  if (GitHubConstants.SUCCESS_STATUS_CODE_SET[inputs.statusCode]) 
		 GitHubUtils.processRESTResponse(inputs.responseBody, inputs.statusCode, outputs, {"id":"id"}, "");
   else {
      outputs.status = GitHubConstants.ERROR;
      if (inputs.statusCode == '401') 
          outputs.error_messages = "Invalid connection and credential alias";
       else {
          if (JSON.stringify(message).indexOf("Not Found") != -1) {
              outputs.error_messages = "Owner repository or user not found";
          }
           else {
              outputs.error_messages = "Unexpected error";
              gs.error(JSON.stringify(message));
          }
      }

  }
})(inputs, outputs);

